import '../css/home.css'
import { Link } from 'react-router-dom';
function Home() {
  return (
    <div>
       <nav className='navbar'>
        <ul className="nav-list">
            <img src="" alt="LOGO" />
            <li>
                <Link to='/'>Home</Link>
            </li>
            <li>
                <Link to='/about'>About</Link>
            </li>
            <li>Map</li>
        </ul>
       </nav>
       <div className='main'>
    
       </div>
    </div>
  );
}

export default Home;
